import React from "react";
import './item.css'

const Item = (props) => {
    return (
        <div className="item">
            <img src={props.image} alt="" />
            <p>{props.name}</p>
            <div className="div item_price">
                <div className="item-price-new">
                &#8377;{props.new_price}
                </div>
                <div className="item-price-old">
                &#8377;{props.old_price}
                </div>
            </div>

        </div>
    )
}

export default Item
